import { Routes, Route } from 'react-router-dom'
import  SignupPage from './pages/SignupPage'

export default function App() {
  const routes = [
    { path: "/", Component: <SignupPage />},
    ]
  return (
    <Routes>
      {routes.map(({ path, Component }) => (
        <Route path={path} element={Component} />
        ))
      }
    </Routes>
  )
}
